import React from "react";

const FooterComponent = () => {


    return (
        <footer>
            <span className="my-footer">


            <p>Hotel Taj is the right choice for visitors who are searching for combination of charm and joyful nature view from where to explore surroundings. 
                Our rooms are appointed to make your stay more comfortable.</p>

                <span>
                <img className="location" src="../images/location.png"></img>
                <a className="location-address" href="https://www.google.com/maps/place/The+Taj+Mahal+Palace,+Mumbai/@18.9220082,72.8332028,17z/data=!3m1!5s0x3be7d1c0c4d5ac1b:0xac82d2d2d765e4f5!4m20!1m10!3m9!1s0x3be7d1c06fffffff:0xc0290485a4d73f57!2sThe+Taj+Mahal+Palace,+Mumbai!5m2!4m1!1i2!8m2!3d18.9216631!4d72.8332028!16zL20vMDZieDFj!3m8!1s0x3be7d1c06fffffff:0xc0290485a4d73f57!5m2!4m1!1i2!8m2!3d18.9216631!4d72.8332028!16zL20vMDZieDFj?entry=ttu">Apollo Bandar, Colaba, Mumbai, Maharashtra 400001</a>

                <br />

                <img className="mail" src="../images/mail.png"></img>
                <a className="mail-address" href="https://www.tajhotels.com/en-in/about-us/contact-us/write-to-us/">care.tajness.gmail.com</a>
                <br />
                <img className="contact" src="../images/phone-call.png"></img>
                <a className="contact-address" href="+91 (22) 6601 1825.">+91 (22) 6601 1825.</a>

                <p>Social Media</p>
                <p>
                <img className="facebook" src="../images/facebook.png"></img>
                <img className="facebook" src="../images/facebook.png"></img>
                <img class="facebook" src="../images/facebook.png"></img>
                </p>
                </span>
                Taj Hotel | All Right Reserved & copied {new Date().getFullYear()}
            </span>
        </footer>
    );
};

export default FooterComponent;
